import { Button } from "..";

function Card({image, title, body}) {
    return (
        <div className="card">
            <div className="card-image">
                <img src={image} alt={title}/>
            </div>
            <div className="card-title">
                {title}
            </div>
            <div className="card-body">
                <p>{body}</p>
            </div>
            <Button name="View Menu"/>
        </div>
    );
}

export default Card;
